import React from 'react'
import { StyleSheet, Text, View } from 'react-native';

const Header = () => {
    return (
        <View>
            <div onClick={myFunction(6)}>
                Hello
            </div>
        </View>
    )
}

export default Header

const myFunction = (a) => {
    console.log('Hello', a);
}
